package isSubsequence;

import isSubsequence_2.Solution;
import org.junit.Assert;
import org.junit.Test;

/**
 * is-subsequence test case
 *
 * @author David Liu
 */
public class TestCase {

    private final isSubsequence_2.Solution solution = new Solution();

    @Test
    public void case1() {
        String s = "abc", t = "ahbgdc";
        boolean expect = true;
        Assert.assertEquals(expect, solution.isSubSequence(s, t));
    }

    @Test
    public void case2() {
        String s = "axc", t = "ahbgdc";
        boolean expect = false;
        Assert.assertEquals(expect, solution.isSubSequence(s, t));
    }

    @Test
    public void case3() {
        String s = "leeeeetcode", t = "";
        boolean expect = true;
        Assert.assertEquals(expect, solution.isSubSequence(s, t));
    }
}
